<h1>Welcome to EasyCoin Bitcoin Wallet</h1>
Now with free Bitcoin mixer, you will always get new coins back when you withdraw from your EasyCoin wallet!<br>
You only pay the Bitcoin transaction fee.<br>
We also support completely free account to account transfers.

<br>
<br>
<br>
<a href="register.php"><img src="rocket.png" alt="">Click here to sign up now!</a>
