<br><br>
<h1>Features of EasyCoin:</h1>
EasyCoin is a newbie friendly easy to use Bitcoin Wallet and Bitcoin Mixer / Laundry.<br>
With EasyCoin you do not have to worry about anonymity and security when using Bitcoin, we take care of that.<br>
Our integrated mixer makes sure none of your deposited Bitcoins get sent when you make a withdrawal, but instead its using funds from other users of the wallet which makes it a true Bitcoin Mixer or Bitcoin Laundry without same coin contamination.<br>
We store all bitcoins encrypted and large amounts only in cold storage, which protects EasyCoin from hackers or other malicious people.<br>
Storing and laundering / mixing your bitcoins has never been easier.<br>
We respect our users privacy and do not store any information, if you are worried about someone knowing about you using Bitcoin, you can use our Tor hidden service: <a href="http://easycoinsayj7p5l.onion/">http://easycoinsayj7p5l.onion/</a><br>
You can use EasyCoin on any device, from your iphone or android phone / tablet to a pc or laptop without installing any programs or apps.<br>
EasyCoin lets you access your bitcoins from any country and location worldwide.<br>

<h1>What is Bitcoin:</h1>
Bitcoin is an anonymous peer-to-peer cryptocurrency invented by someone who gave himself the pseudonym Satoshi Nakamoto in 2009.<br>
It now has millions of users and all bitcoins together are worth over a billion US dollar.<br>
All you need to use Bitcoins as a payment method on the internet is a Bitcoin Wallet like EasyCoin and some website or person to buy Bitcoins from.<br>
But bitcoin is only truly anonymous and untraceable if you are really careful not disclosing your identity.<br>
Easycoin is trying to help with that and protects its users privacy by default instead of having the user take care of it like all other bitcoin wallets.<br>
An observer wont be able to track you on the bitcoin blockchain when you use EasyCoin bitcoin wallet.<br>

<h1>How to get started:</h1>
