        <div itemscope itemtype="http://schema.org/Person">
          <meta itemprop="photo" content="https://mike.tig.as/_photo/headshot2018.jpg" />

        <p style="width:250px;margin-top:0"><strong><a href="/about/"><span itemprop="name">Mike Tigas</span></a></strong> is a developer, journalist, photographer, civic hacker, and security/privacy tinkerer. He works at <a href="http://www.propublica.org/"><b><span itemprop="org">ProPublica</span></b></a> and is a core contributor to <a href="https://www.torproject.org"><b>the Tor Project</b></a>.</p>
        <p style="width:250px">His work includes <a href="http://www.propublica.org/nerds/">news applications</a>, privacy software (<a href="https://onionbrowser.com/">Onion Browser</a>), data tools (<a href="http://tabula.technology/">Tabula</a>, <a href="https://github.com/CivOmega/civomega">CivOmega</a>), <a href="/about/#talks">talks &amp; workshops</a>, &amp; lots of <a href="/about/">other good stuff</a>.</p>
        </div>

