<script type="application/javascript">
$(function() {
  function shuffleArray(array) {
      for (var i = array.length - 1; i > 0; i--) {
          var j = Math.floor(Math.random() * (i + 1));
          var temp = array[i];
          array[i] = array[j];
          array[j] = temp;
      }
  }
  var imgs = [
    "2008a01.jpg",
    "2014a01.jpg",
    "2014a02.jpg",
    "2014a03.jpg",
