  shuffleArray(imgs);
  console.log(imgs);
  for (let i=0; i<6; i++) {
    var im = $('<a href="/photography/" style="border:none"><img src="https://mike.tig.as/_photo/sm/'+imgs[i]+'"/></a>');
    $("#homepage_images").append(im);
    $("#homepage_images").append(" ");
